{"label":"App", "color":"lightsalmon", "size":"180 35", "category":"Hierarchy_CodeInGraph", "isFile":true, "fileContent":"<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="utf-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <!-- The above 3 meta tags *must* come first in the head; any other head content must come *after* these tags -->
    <title>App Landy : Home</title>
    <!-- Favicon -->
    <link rel="shortcut icon" type="image/icon" href="fileServer/IntegratorTest2/assets/images/favicon.ico"/>
    <!-- Font Awesome -->
    <link href="fileServer/IntegratorTest2/assets/css/font-awesome.css" rel="stylesheet">
    <!-- Bootstrap -->
    <link href="fileServer/IntegratorTest2/assets/css/bootstrap.css" rel="stylesheet">    
    <!-- Slick slider -->
    <link rel="stylesheet" type="text/css" href="fileServer/IntegratorTest2/assets/css/slick.css"/> 
    <!-- Fancybox slider -->
    <link rel="stylesheet" href="fileServer/IntegratorTest2/assets/css/jquery.fancybox.css" type="text/css" media="screen" /> 
    <!-- Animate css -->
    <link rel="stylesheet" type="text/css" href="fileServer/IntegratorTest2/assets/css/animate.css"/>  
     <!-- Theme color -->
    <link id="switcher" href="fileServer/IntegratorTest2/assets/css/theme-color/default-theme.css" rel="stylesheet">

    <!-- Main Style -->
    <!--link href="style.css" rel="stylesheet"-->
    <style>
      
      /*
      
      Template Name: App Landy
      Author: MarkUps
      Author URI: http://www.markups.io/
      Description: App Landy - Single page App Landing HTML5 Template.
      Version: 1.0
      Tags: light, white, single page, multipurpose, one page, custom-colors, Bootstrap, responsive, html5, css3
      
      */
      
      
      /* Table of Content
      ==================================================
      #BASIC TYPOGRAPHY
      #HEADER	
      #MENU 
      #FEATURES
      #HOW IT WORKS
      #PRICING TABLE  
      #SCREENSHOT
      #DOWNLOAD
      #TESTIMONIAL
      #PRICING TABLE
      #TESTIMONIAL
      #SUBSCRIBE
      #CONTACT
      #FOOTER
      #ERROR PAGE
      #RESPONSIVE STYLE
      */
      
      
      /*--------------------*/
      /* BASIC TYPOGRAPHY */
      /*--------------------*/
      
      body,html{
        	overflow-x:hidden;  	
      }
      
      body {
      	font-family: 'Open Sans', sans-serif;
      	font-size: 16px;
      	overflow-x: hidden !important;
      	color: #838282;
      }
      
      ul{
      	padding: 0;
      	margin: 0;
      	list-style: none;
      }
      
      a{ 
      	text-decoration: none;
      	color: #2f2f2f;  
      }
      
      a:focus{
      	outline: none;
      	text-decoration: none;
      }
      
      h1,h2,h3,h4,h5,h6{
      	font-family: 'Cabin', sans-serif;
      }
      
      h2 {
      	color: #fff;  
      	font-size: 30px;
      	font-weight: 700;
      	line-height: 40px;
      	margin: 0;
      	padding-bottom: 10px;  
      }
      
      img{
       border:none;
      }
      
      /* Preloader */
      
      #preloader {
        position: fixed;
        top:0;
        left:0;
        right:0;
        bottom:0;
        background-color:#fff; /* change if the mask should have another color then white */
        z-index:99999; /* makes sure it stays on top */ 
      }
      
      #status {
        width:200px;
        height:200px;
        position:absolute;
        left:50%; /* centers the loading animation horizontally one the screen */
        top:50%; /* centers the loading animation vertically one the screen */
        background-image:url(fileServer/IntegratorTest2/assets/images/loader.gif); /* path to your loading animation */
        background-repeat:no-repeat;
        background-position:center;
        margin:-100px 0 0 -100px; /* is width and height divided by two */
      }
      
      /*--------------------*/
      /* HEADER */
      /*--------------------*/
      
      #header{
      	float: left;
      	display: inline;
      	width: 100%;
      }
      
      
      .header-inner{	
      	display: inline;
      	position: relative;
      	float: left;	
      	width: 100%;
      }
      
      
      .overlay{
      	background-color: rgba(0, 0, 0, 0.6);
      	height: 100%;
      	left: 0;
      	position: absolute;
      	top: 0;
      	width: 100%;
      	z-index: 10;
      }
      
      
      .header-content {
      	float: left;
      	width: 100%;
      	height: 100%;
      	text-align: center;
      }
      
      
      .header-top {
      	display: inline;
      	float: left;
      	padding-top: 50px;
      	width: 100%;
      }
      
      
      .logo-area{
      	display: inline;
      	float: left;
      }
      
      
      .logo {
        color: #fff;
        font-family: "Pacifico",cursive;
        font-size: 40px;
        font-weight: bold;
      }
      
      
      .logo:hover,
      .logo:focus{
      	text-decoration: none;
      	outline: none;
      	color: #fff;
      }
      
      
      .menu-area{
      	display: inline;	
      }
      
      
      .main-wrap{
      	position: relative;
      }
      
      
      .header-bottom {
      	display: inline;
      	float: left;
      	margin-top: 70px;
      	width: 100%;
      }
      
      
      .header-bottom-left {
      	display: inline;
      	float: left;
      	padding-top: 60px;
      	padding-right: 50px;
      	text-align: left;
      	width: 100%;
      }
      
      
      .header-bottom-left h1 {
      	color: #fff;
      	font-size: 40px;
      	font-weight: bold;
      	line-height: 60px;
      	text-transform: uppercase;
      }
      
      
      .header-bottom-left p {
      	color: #fff;
      	font-size: 16px;
      	margin: 35px 0 0;
      }
      
      
      .download-btn{
      	border-radius: 3px;
      	color: #ffffff;
      	display: block;
      	float: left;
      	font-size: 16px;
      	height: 48px;
      	line-height: 48px;
      	margin-top: 30px;
      	opacity: 0.8;
      	text-align: center;
      	width: 180px;
      	-webkit-transition: all 0.5s ease 0s;;
      	-o-transition: all 0.5s ease 0s;;
